import React from "react";
import { Link } from "react-router-dom";

const DashboardActions = () => {
  return (
    <div className="flex flex-col space-y-4">
      <Link
        to="/edit-profile"
        className="flex items-center justify-center bg-gray-700 text-white py-2 px-4 rounded-lg shadow-md hover:bg-gray-600 transition duration-300"
      >
        <i className="fas fa-user-circle text-blue-400 text-xl mr-2"></i>
        <span className="font-semibold">Edit Profile</span>
      </Link>
      <Link
        to="/add-experience"
        className="flex items-center justify-center bg-gray-700 text-white py-2 px-4 rounded-lg shadow-md hover:bg-gray-600 transition duration-300"
      >
        <i className="fab fa-black-tie text-blue-400 text-xl mr-2"></i>
        <span className="font-semibold">Add Experience</span>
      </Link>
      <Link
        to="/add-education"
        className="flex items-center justify-center bg-gray-700 text-white py-2 px-4 rounded-lg shadow-md hover:bg-gray-600 transition duration-300"
      >
        <i className="fas fa-graduation-cap text-blue-400 text-xl mr-2"></i>
        <span className="font-semibold">Add Education</span>
      </Link>
    </div>
  );
};

export default DashboardActions;
